import PRODUCT_LIST_BY_ID from '../constants/productConstant';

const cartReducer = (state, { cartCollection: [] }, action) => {
  switch (action.type) {
    case PRODUCT_LIST_BY_ID:
      return { PRODUCT_LIST_BY_ID: action.payload };
    default:
      return state;
  }
};
export default cartReducer;
